func TestFilterTool(t *testing.T) {
	dataStr := make([]string, 0)
	dataInt := make([]int, 0)
	for i := 0; i < 2; i++ {
		for i := 0; i < 10000000; i++ {
			dataStr = append(dataStr, strconv.Itoa(i))
			dataInt = append(dataInt, i)
		}
	}
	t.Logf("DataStr: %d", len(dataStr))
	t.Logf("DataInt: %d", len(dataInt))
	t.Logf("DataStr: %d", len(RemoveDuplicateStr(dataStr)))
	t.Logf("DataInt: %d", len(RemoveDuplicateInt(dataInt)))
}

