func TestRandomTool(t *testing.T) {
	uuidArr := make([]string, 0)
	strArr := make([]string, 0)
	codeArr := make([]string, 0)
	numArr := make([]int, 0)
	var (
		wg    sync.WaitGroup
		mutex sync.Mutex
	)
	n := 200000
	for i := 0; i < n; i++ {
		wg.Add(1)
		go func() {
			rangeString := NewRandom().String(6)
			rangeCode := NewRandom().Code(6)
			rangeNum := NewRandom().Num(100000, 999999)
			mutex.Lock()
			uuidArr = append(uuidArr, UUID())
			strArr = append(strArr, rangeString)
			codeArr = append(codeArr, rangeCode)
			numArr = append(numArr, rangeNum)
			mutex.Unlock()
			wg.Done()
		}()
	}
	wg.Wait()
	t.Log(uuidArr[:10])
	t.Logf("uuidArr %d : %d", len(uuidArr), n-len(RemoveDuplicateStr(uuidArr)))
	t.Log(strArr[:10])
	t.Logf("strArr %d : %d", len(strArr), n-len(RemoveDuplicateStr(strArr)))
	t.Log(codeArr[:10])
	t.Logf("codeArr %d : %d", len(codeArr), n-len(RemoveDuplicateStr(codeArr)))
	t.Log(numArr[:10])
	t.Logf("numArr %d : %d", len(numArr), n-len(RemoveDuplicateInt(numArr)))
}

func TestRSATool(t *testing.T) {
	pubKey, priKey, err := GenRsaKey(2048)
	if err != nil {
		t.Error(err)
		return
	}
	data, err := PublicEncrypt(pubKey, "123456")
	if err != nil {
		t.Error(err)
		return
	}
	t.Logf(": %s", data)
	out, err := PrivateDecrypt(priKey, data)
	if err != nil {
		t.Error(err)
		return
	}
	t.Logf(": %s", out)
}

